import React from "react";
import { Col, Row } from "react-bootstrap";

function AboutUs() {
  return (
    <>
      <Row>
        <Col>
          <div></div>
          <h1>About</h1>
        </Col>
      </Row>
    </>
  );
}

export default AboutUs;
